import axios from 'axios';
/*export const book = () => {
    return{
        type:'BOOK'
    }
}*/

export const book = ({name,phno,email,startDate}) => {
    return dispatch => {
        axios.post('http://localhost:5000/meetings',{
            doc_id:"id1",
            name:name,
            email:email,
            phno:phno,
            start_date:startDate,
            end_date:startDate
        }).then(res => {console.log(res.data)})
    }
}
